import "hardhat/console.sol";
contract AgreementViolation {
    
    enum ViolationType {
        PaymentNotCompleted,
        DataNotTransferredAsDescribed,
        DataNotAsDescribed,
        LicenseViolated
    }
    enum Penalty {
        Terminate,
        InsurancePaymentByConsumer,
        NewTranferDateForProvider,
        NewTranferDateForProviderAndReductionOfPayment,
        CorrectDataByProvider,
        ReductionOfPayment
    }

    enum ResolutionType { Verification, Dispute }
    enum ResolutionState { Completed, NotCompleted, Accepted, Denied }

    struct Violation {
        ViolationType violationType;
        string issuerId;
    }

    struct SignedResolution {
        string proofType;
        string resolutionType;
        string resolution;
        string dataExchangeId;
        uint256 iat;
        string iss;
        string sub;
    }
    
    
    mapping(uint256 => Violation) public violations;
 
    mapping(string => uint256) dataExchangeToAgreementId;

    mapping(string => string[]) public dataExchangeIdToPenalty;

    event ResolutionDenied(string providerId, string consumerId, uint256 id);
    
    
    function mapAgreementIdByExchangeId(string memory _dataExchangeId, uint256 _agreementId) public{
        dataExchangeToAgreementId[_dataExchangeId]=_agreementId;
    }

    function getAgreementIdByExchangeId(string memory _dataExchangeId) public view returns (uint256) {
        return dataExchangeToAgreementId[_dataExchangeId];
    }

    function evaluateResolution(
        string memory _proofType,
        string memory _type,
        string memory _resolution,
        string memory _dataExchangeId,
        uint256 _iat,
        string memory _iss,
        string memory _sub)  public { 

        SignedResolution memory signedResolution;
        signedResolution.proofType = _proofType;
        signedResolution.resolutionType = _type;
        signedResolution.resolution = _resolution;
        signedResolution.dataExchangeId = _dataExchangeId;
        signedResolution.iat = _iat;
        signedResolution.iss = _iss;   
        signedResolution.sub = _sub;

        uint256 agreementId = getAgreementIdByExchangeId(_dataExchangeId);

        if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("completed"))){
                             //If agreement already had penalties and now the resolution is completed
                             delete dataExchangeIdToPenalty[_dataExchangeId];
             
        }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("notCompleted"))) { //ResolutionState.NotCompleted){
                //Decryption key not published (data tranfer not as described)

                violations[agreementId] = Violation(ViolationType.DataNotTransferredAsDescribed, signedResolution.sub);
                
                dataExchangeIdToPenalty[_dataExchangeId].push("Terminate");
                dataExchangeIdToPenalty[_dataExchangeId].push("NewTranferDateForProvider");
                dataExchangeIdToPenalty[_dataExchangeId].push("NewTranferDateForProviderAndReductionOfPayment"); 

                  
        }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("accepted"))){ //ResolutionState.Accepted)
                violations[agreementId] = Violation(ViolationType.DataNotTransferredAsDescribed, signedResolution.sub);

                dataExchangeIdToPenalty[_dataExchangeId].push("Terminate");
                dataExchangeIdToPenalty[_dataExchangeId].push("NewTranferDateForProvider");
                dataExchangeIdToPenalty[_dataExchangeId].push("NewTranferDateForProviderAndReductionOfPayment"); 
             }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("denied")))//ResolutionState.Denied)
                //the cipherblock can be properly decrypted
                emit ResolutionDenied("provider","consumer",agreementId);

    }

    function getPenaltyChoices(string memory _dataExchangeId) public view returns (uint256, string[] memory){
        uint256 agreementId = getAgreementIdByExchangeId(_dataExchangeId);
        return (agreementId, dataExchangeIdToPenalty[_dataExchangeId]);
    }

    function issueViolation(uint256 _agreementId, ViolationType _violationType, string memory _issuerId) public{
        violations[_agreementId] = Violation(_violationType, _issuerId);
    }

